VALUES ('3606510000270', 'Fish and Chips', 'FR : Portions de filets de Colin d\'Alaska préformées, enrobées de pâte à beignet, préfrites, surgelées et pommes de terre préfrites et surgelées. Malgré un soin tout particulier pour enlever toutes les arêtes, quelques-unes peuvent exceptionnellement subsister dans ce produit. Ingrédients Beignets de poisson (42%) : Filets de Colin d\'Alaska* 65%, farine de blé enrichie (farine de blé, carbonate de calcium, fer, niacine, thiamine), huiles végétales (colza et tournesol), chapelure (contient blé), eau, amidon de blé, farine dé maïs, dextrose, sel, gluten, poudres à lever (E450; E500; E503). Frites (58%) : pommes de terre, huile de tournesol, dextrose. Peut contenir des traces de lait et de sésame. *Colin d\'Alaska (Theragra chalcogramma) pêché en A) Océan Pacifique Nord-Ouest FAO 61 ou B) Océan Paçifique Nord-Est FAO 67. Pour déterminer la zone de pêche, voir la lettre suivant la DLUO.', 'https://static.openfoodfacts.org/images/products/360/651/000/0270/front_fr.4.400.jpg', '10', '0.7', '15', '3.7', '', '12', '0.73', '0.28740157480315', '', '1');

